import React from 'react'
import menuItems from '../menudata'
import Menu from '../components/Menu'
export default function Homescreen() {
    return (
        <div>
            <div className="row">
                {
                    menuItems.map(item => {
                        return <div className="col-md-4">
                            <div>
                                <Menu items={item}></Menu>
                            </div>
                            
                        </div>

                    })
                }
            </div>
        </div>
    )
}
